import React from "react";
import "./styles.css";
import weatherData from "./weatherData";
import WeatherIcons from "./components/WeatherIcons";

export default function App() {
  return (
    <div className="App">
      <h1>My WeatherIcons App</h1>
      {weatherData.map((x) => (
        <WeatherIcons
          cow={x.img}
          horse={x.conditions}
          sheep={x.time}
        ></WeatherIcons>
      ))}
    </div>
  );
}
